const Footerlink = () => {
     return (
         <a
           key={key}
           href={element.url}
           target="_blank"
           className="link-secondary px-1"
           rel="noopener noreferrer"
           style={
           {  
          textDecoration: 'none'
          }}>{element.name}</a>
 )                  
}
export default Footerlink;
